import React, { Component } from 'react';
import Customer from './components/Customer'
import './App.css';

// INSERT VALUE
const customers = [
  {
  'id': 1,
  'image': 'https://placeimg.com/64/64/any',
  'name': '이승찬',
  'birthday': '960208',
  'gender': '남자',
  'job': '취준생'
  },
  {
  'id': 2,
  'image': 'https://placeimg.com/64/64/any',
  'name': '신영진',
  'birthday': '961212',
  'gender': '남자',
  'job': '회사원'
  }
]

// Customer
class App extends Component {
  render() {
    return (
      <div>
        <Customer 
          id={customers[0].id}
          image={customers[0].image}
          name={customers[0].name}
          birthday={customers[0].birthday}
          gender={customers[0].gender}
          job={customers[0].job}
        />
        <Customer 
          id={customers[0].id}
          image={customers[0].image}
          name={customers[0].name}
          birthday={customers[0].birthday}
          gender={customers[0].gender}
          job={customers[0].job}
        />
      </div>
    );
  }
}

// Public Option
export default App;
